import React, { useState } from 'react';
import axios from 'axios';

function AdminPage() {
    const [carInfo, setCarInfo] = useState({
        vin: '',
        exterior_color: '',
        interior_color: '',
        make: '',
        model: '',
        fuel: '',
        year: '',
        list_time: '',
        list_price: '',
        current_mileage: '',
        car_type: '', // Add a field to select the car type
        // Additional fields for specific car types can be added here
    });

    const handleChange = (e) => {
        setCarInfo({ ...carInfo, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post(`${process.env.REACT_APP_API_URL}/api/add-car/`, carInfo);
            console.log(response.data);
            // Handle success (e.g., clear form, show success message)
        } catch (error) {
            console.error('Error adding car:', error.response?.data?.message || 'Error');
            // Handle error (e.g., show error message)
        }
    };

    return (
        <div className="admin-page">
            <h2>Add Car</h2>
            <form onSubmit={handleSubmit}>
                {/* Form fields for car information */}
                <input type="text" name="vin" value={carInfo.vin} onChange={handleChange} placeholder="VIN" required />
                {/* Add more input fields for other car attributes */}
                <select name="car_type" value={carInfo.car_type} onChange={handleChange} required>
                    <option value="">Select Car Type</option>
                    <option value="Convertible">Convertible</option>
                    <option value="Electric">Electric</option>
                    <option value="Hybrid">Hybrid</option>
                    <option value="SUV">SUV</option>
                    <option value="Sedan">Sedan</option>
                    <option value="Truck">Truck</option>
                </select>
                {/* Add more input fields for specific car types if needed */}
                <button type="submit">Add Car</button>
            </form>
        </div>
    );
}

export default AdminPage;
